struct Uniforms {
    resolution: vec3 < f32 > ,
    time: f32
};

@group(0) @binding(0) var < uniform > uniforms: Uniforms;
@group(0) @binding(1) var linearSampler: sampler;

struct VertexOutput {
    @builtin(position) pos: vec4 < f32 > ,
        @location(0) uv: vec2 < f32 >
};

const MAX_STEPS: i32 = 100;
const MAX_DIST: f32 = 100.0;
const SURFACE_DIST: f32 = 0.001;
const LIGHT_POS: vec3 < f32 > = vec3 < f32 > (-2.0, 1.0, 3.0);

fn estimateNormal(pos: vec3 < f32 > ) -> vec3 < f32 > {
    let e: vec2 < f32 > = vec2 < f32 > (1.0, -1.0) * 0.5773 * 0.0005;
    return normalize(
        e.xyy * map(pos + e.xyy) +
        e.yyx * map(pos + e.yyx) +
        e.yxy * map(pos + e.yxy) +
        e.xxx * map(pos + e.xxx)
    );
}

fn calculateLight(p: vec3 < f32 > , viewDir: vec3 < f32 > , normal: vec3 < f32 >,
                 lightPos:vec3<f32>) -> vec3 < f32 > {
    let ambientStrength: f32 = 0.1;
    let ambient: vec3 < f32 > = vec3 < f32 > (0.1, 0.1, 0.1) * ambientStrength;

    let lightDir: vec3 < f32 > = normalize(lightPos - p);
    let diffuseStrength: f32 = 0.7;
    let diffuse: vec3 < f32 > = vec3 < f32 > (1.0, 1.0, 1.0) * diffuseStrength * max(dot(normal, lightDir), 0.0);

    let viewDirNorm: vec3 < f32 > = normalize(viewDir);
    let reflectDir: vec3 < f32 > = reflect(-lightDir, normal);
    let specularStrength: f32 = 0.5;
    let shininess: f32 = 16.0;
    let specular: vec3 < f32 > = vec3 < f32 > (1.0, 1.0, 1.0) * specularStrength * pow(max(dot(viewDirNorm, reflectDir), 0.0), shininess);

    return ambient + diffuse + specular;
}

fn calculateAO(p: vec3 < f32 > , normal: vec3 < f32 > ) -> f32 {
    let aoRadius: f32 = 0.1;
    let aoSamples: i32 = 5;
    var occlusion: f32 = 0.0;
    for (var i: i32 = 1; i <= aoSamples; i = i + 1) {
        let stepSize: f32 = aoRadius / f32(i);
        let samplePoint: vec3 < f32 > = p + normal * stepSize;
        let sampleDist: f32 = map(samplePoint);
        occlusion += stepSize - sampleDist;
    }
    occlusion = 1.0 - (occlusion / f32(aoSamples));
    return occlusion;
}

fn rotationMatrixY(angle: f32) -> mat3x3 < f32 > {
    let c: f32 = cos(angle);
    let s: f32 = sin(angle);
    return mat3x3 < f32 > (
        vec3 < f32 > (c, 0.0, s),
        vec3 < f32 > (0.0, 1.0, 0.0),
        vec3 < f32 > (-s, 0.0, c)
    );
}

fn mandelbulbSDF(p: vec3<f32>) -> f32 {
    let angle: f32 = uniforms.time * 0.1;
    let rotMat: mat3x3<f32> = rotationMatrixY(angle);
    var pRot: vec3<f32> = rotMat * p;

    var z: vec3<f32> = pRot;
    var dr: f32 = 1.0;
    var r: f32 = 0.0;

    let timePower: f32 = 8.0 + 2.0 * sin(uniforms.time * 0.5);  // Varies between 6.0 and 10.0
    for (var i: i32 = 0; i < 4; i = i + 1) {
        r = length(z);
        if (r > 2.0) {
            break;
        }
        var theta: f32 = acos(z.z / r);
        var phi: f32 = atan2(z.y, z.x);
        dr = pow(r, timePower - 1.0) * timePower * dr + 1.0;
        var zr: f32 = pow(r, timePower);
        theta = theta * timePower;
        phi = phi * timePower;
        z = zr * vec3<f32>(sin(theta) * cos(phi), sin(theta) * sin(phi), cos(theta));
        z = z + pRot;
    }
    return 0.5 * log(r) * r / dr;
}


fn map(point: vec3 < f32 > ) -> f32 {
    return mandelbulbSDF(point);
}

// Hash function
fn hash(n: f32) -> f32 {
    return fract(sin(n) * 43758.5453123);
}

// Linear interpolation
fn lerp(a: f32, b: f32, t: f32) -> f32 {
    return mix(a, b, t);
}

// Gradient function
fn gradient(hash: f32, x: f32, y: f32) -> f32 {
    let h = hash * 6.28318530718; // Convert hash to radians
    let nx = cos(h);
    let ny = sin(h);
    return nx * x + ny * y;
}

// Perlin noise function
fn perlinNoise(p: vec2<f32>) -> f32 {
    let ix = floor(p.x);
    let iy = floor(p.y);

    let fx = fract(p.x);
    let fy = fract(p.y);

    let u = fx * fx * (3.0 - 2.0 * fx);
    let v = fy * fy * (3.0 - 2.0 * fy);

    let nx0 = gradient(hash(ix), fx, fy);
    let nx1 = gradient(hash(ix + 1.0), fx - 1.0, fy);
    let n0 = lerp(nx0, nx1, u);

    let ny0 = gradient(hash(iy), fx, fy);
    let ny1 = gradient(hash(iy + 1.0), fx, fy - 1.0);
    let n1 = lerp(ny0, ny1, u);

    return lerp(n0, n1, v);
}

// Function to generate fractal brownian motion (FBM) noise
fn fbm(p: vec2<f32>, octaves: i32, lacunarity: f32, persistence: f32, offset: f32) -> f32 {
    var total: f32 = 0.0;
    var amplitude: f32 = 1.0;
    var frequency: f32 = 1.0;

    for (var i: i32 = 0; i < octaves; i = i + 1) {
        total = total + perlinNoise(p * frequency + vec2<f32>(offset, offset)) * amplitude;
        frequency = frequency * lacunarity;
        amplitude = amplitude * persistence;
    }
    return total;
}





fn background(uv: vec2 < f32 > ) -> vec3 < f32 > {
    // Simple gradient background
    let colorTop: vec3 < f32 > = vec3 < f32 > (0.2, 0.3, 0.6); // Dark blue
    let colorBottom: vec3 < f32 > = vec3 < f32 > (0.7, 0.8, 1.0); // Light blue
    return mix(colorBottom, colorTop, uv.y * 0.5 + 0.5);
}

fn main(fragCoord: vec2 < f32 > ) -> vec4 < f32 > {

     let uv: vec2 < f32 > = (2.*fragCoord.xy-uniforms.resolution.xy) / uniforms.resolution.y;


    let backgroundColor: vec3 < f32 > = background(uv);

    var color: vec3 < f32 > = vec3 < f32 > (0.0, 0.0, 0.0);

    let cameraPos: vec3 < f32 > = vec3 < f32 > (0.0, 0.0, 2.0);
    let rayDir: vec3 < f32 > = normalize(vec3 < f32 > (uv, -1.0));
    var hit: bool = false;
    var t: f32 = 0.0;




    for (var i: i32 = 0; i < MAX_STEPS; i = i + 1) {
        let currentPos: vec3 < f32 > = cameraPos + t * rayDir;
        let dist: f32 = map(currentPos);
        if (dist < SURFACE_DIST) {
           // Calculate time-dependent offset for light position animation
        let lightOffset: vec3<f32> = vec3<f32>(sin(uniforms.time * 0.1), cos(uniforms.time * 0.1), 0.0);
        let animatedLightPos: vec3<f32> = LIGHT_POS + lightOffset;

            let normal: vec3 < f32 > = estimateNormal(currentPos);
            let lightColor: vec3 < f32 > = calculateLight(currentPos, rayDir, normal,animatedLightPos);
            let ao: f32 = calculateAO(currentPos, normal);
            let reflectionDir: vec3 < f32 > = reflect(rayDir, normal);
            let reflectionColor: vec3 < f32 > = background(reflectionDir.xy);

            color = lightColor * ao + reflectionColor * 0.5; // Apply lighting, AO, and reflection
            hit = true;
            break;
        }
        if (t > MAX_DIST) {
            break;
        }
        t = t + dist;
    }

    if (!hit) {
        color = backgroundColor; // If no hit, use the background color
    }


    return vec4 < f32 > (color, 1.0);
}

