// Function to create a rotation matrix for a given vector and angle.
fn rotate(v: vec3<f32>, angle: f32) -> mat3x3<f32> {
    let c: f32 = cos(angle);
    let s: f32 = sin(angle);
    return mat3x3<f32>(
        c + (1. - c) * v.x * v.x, (1. - c) * v.x * v.y - s * v.z, (1. - c) * v.x * v.z + s * v.y,
        (1. - c) * v.x * v.y + s * v.z, c + (1. - c) * v.y * v.y, (1. - c) * v.y * v.z - s * v.x,
        (1. - c) * v.x * v.z - s * v.y, (1. - c) * v.y * v.z + s * v.x, c + (1. - c) * v.z * v.z
    );
}

// Function to generate a hash value for a given 3D vector.
fn hash(p: vec3<f32>) -> vec3<f32> {
    var p_var = p;
    p_var = vec3<f32>(
        dot(p_var, vec3<f32>(127.1, 311.7, 74.7)), 
        dot(p_var, vec3<f32>(269.5, 183.3, 246.1)), 
        dot(p_var, vec3<f32>(113.5, 271.9, 124.6))
    );
    return -1. + 2. * fract(sin(p_var) * 43758.547);
}

// Function to generate noise for a given 3D vector.
fn noised(x: vec3<f32>) -> vec4<f32> {
    let p: vec3<f32> = floor(x);
    let w: vec3<f32> = fract(x);
    let u: vec3<f32> = w * w * w * (w * (w * 6. - 15.) + 10.);
    let du: vec3<f32> = 30. * w * w * (w * (w - 2.) + 1.);
    let ga: vec3<f32> = hash(p + vec3<f32>(0., 0., 0.));
    let gb: vec3<f32> = hash(p + vec3<f32>(1., 0., 0.));
    let gc: vec3<f32> = hash(p + vec3<f32>(0., 1., 0.));
    let gd: vec3<f32> = hash(p + vec3<f32>(1., 1., 0.));
    let ge: vec3<f32> = hash(p + vec3<f32>(0., 0., 1.));
    let gf: vec3<f32> = hash(p + vec3<f32>(1., 0., 1.));
    let gg: vec3<f32> = hash(p + vec3<f32>(0., 1., 1.));
    let gh: vec3<f32> = hash(p + vec3<f32>(1., 1., 1.));
    let va: f32 = dot(ga, w - vec3<f32>(0., 0., 0.));
    let vb: f32 = dot(gb, w - vec3<f32>(1., 0., 0.));
    let vc: f32 = dot(gc, w - vec3<f32>(0., 1., 0.));
    let vd: f32 = dot(gd, w - vec3<f32>(1., 1., 0.));
    let ve: f32 = dot(ge, w - vec3<f32>(0., 0., 1.));
    let vf: f32 = dot(gf, w - vec3<f32>(1., 0., 1.));
    let vg: f32 = dot(gg, w - vec3<f32>(0., 1., 1.));
    let vh: f32 = dot(gh, w - vec3<f32>(1., 1., 1.));
    return vec4<f32>(
        va + u.x * (vb - va) + u.y * (vc - va) + u.z * (ve - va) +
        u.x * u.y * (va - vb - vc + vd) +
        u.y * u.z * (va - vc - ve + vg) +
        u.z * u.x * (va - vb - ve + vf) +
        (-va + vb + vc - vd + ve - vf - vg + vh) * u.x * u.y * u.z,
        ga + u.x * (gb - ga) + u.y * (gc - ga) + u.z * (ge - ga) +
        u.x * u.y * (ga - gb - gc + gd) +
        u.y * u.z * (ga - gc - ge + gg) +
        u.z * u.x * (ga - gb - ge + gf) +
        (-ga + gb + gc - gd + ge - gf - gg + gh) * u.x * u.y * u.z + 
        du * (vec3<f32>(vb, vc, ve) - va + u.yzx * vec3<f32>(
            va - vb - vc + vd, va - vc - ve + vg, va - vb - ve + vf
        ) + u.zxy * vec3<f32>(
            va - vb - ve + vf, va - vb - vc + vd, va - vc - ve + vg
        ) + u.yzx * u.zxy * (-va + vb + vc - vd + ve - vf - vg + vh))
    );
}

// Function to map the distance to a specific function.
fn map(p: vec3<f32>) -> f32 {
    var d: f32 = p.y;
    let c: f32 = max(0., pow(distance(p.xz, vec2<f32>(0., 16.)), 1.));
    let cc: f32 = pow(smoothstep(20., 5., c), 2.);
    var n: vec4<f32> = noised(vec3<f32>(p.xz * 0.07, uniforms.time * 0.5));
    var nn: f32 = n.x * length(n.yzw);
    n = noised(vec3<f32>(p.xz * 0.173, uniforms.time * 0.639));
    nn = nn + (0.25 * n.x * length(n.yzw));
    nn = smoothstep(-0.5, 0.5, nn);
    d = d - 6. * nn * cc;
    return d;
}

// Function to calculate the error term for distance estimation.
fn err(dist: f32) -> f32 {
    var dist_var = dist;
    dist_var = dist_var / 100.;
    return min(0.01, dist_var * dist_var);
}

// Function for distance reduction.
fn dr(origin: vec3<f32>, direction: vec3<f32>, position: vec3<f32>) -> vec3<f32> {
    var position_var = position;
    var iterations: i32 = 3;
    for (var i: i32 = 0; i < iterations; i = i + 1) {
        position_var = position_var + direction * (map(position_var) - err(distance(origin, position_var)));
    }
    return position_var;
}

// Function to find the intersection of a ray and an object.
fn intersect(ro: vec3<f32>, rd: vec3<f32>) -> vec3<f32> {
    var p: vec3<f32> = ro + rd;
    var t: f32 = 0.;
    for (var i: i32 = 0; i < 150; i = i + 1) {
        let d: f32 = 0.5 * map(p);
        t = t + (d);
        p = p + (rd * d);
        if (d < 0.01 || t > 60.) {
            break;
        }
    }
    p = dr(ro, rd, p);
    return p;
}

// Function to calculate geometric attenuation.
fn G1V(dnv: f32, k: f32) -> f32 {
    return 1. / (dnv * (1. - k) + k);
}

// Function to calculate the GGX microfacet model.
fn ggx(n: vec3<f32>, v: vec3<f32>, l: vec3<f32>, rough: f32, f0: f32) -> f32 {
    let alpha: f32 = rough * rough;
    let h: vec3<f32> = normalize(v + l);
    let dnl: f32 = clamp(dot(n, l), 0., 1.);
    let dnv: f32 = clamp(dot(n, v), 0., 1.);
    let dnh: f32 = clamp(dot(n, h), 0., 1.);
    var dlh: f32 = clamp(dot(l, h), 0., 1.);
    var f: f32;
    var d: f32;
    var vis: f32;
    let asqr: f32 = alpha * alpha;
    let pi: f32 = 3.14159;
    let den: f32 = dnh * dnh * (asqr - 1.) + 1.;
    d = asqr / (pi * den * den);
    dlh = pow(1. - dlh, 5.);
    f = f0 + (1. - f0) * dlh;
    let k: f32 = alpha / 1.;
    vis = G1V(dnl, k) * G1V(dnv, k);
    let spec: f32 = dnl * d * f * vis;
    return spec;
}

// Function to calculate the normal at a point.
fn normal(p: vec3<f32>) -> vec3<f32> {
    let e: f32 = 0.01;
    return normalize(vec3<f32>(
        map(p + vec3<f32>(e, 0., 0.)) - map(p - vec3<f32>(e, 0., 0.)),
        map(p + vec3<f32>(0., e, 0.)) - map(p - vec3<f32>(0., e, 0.)),
        map(p + vec3<f32>(0., 0., e)) - map(p - vec3<f32>(0., 0., e))
    ));
}

// Function to calculate subsurface scattering.
fn subsurface(p: vec3<f32>, v: vec3<f32>, n: vec3<f32>) -> f32 {
    let d: vec3<f32> = refract(v, n, 1. / 1.5);
    var o: vec3<f32> = p;
    var a: f32 = 0.;
    var max_scatter: f32 = 2.5;
    for (var i: f32 = 0.1; i < max_scatter; i = i + 0.2) {
        o = o + (i * d);
        let t: f32 = map(o);
        a = a + (t);
    }
    let thickness: f32 = max(0., -a);
    let scatter_strength: f32 = 16.;
    return scatter_strength * pow(max_scatter * 0.5, 3.) / thickness;
}

// Function to shade a point based on lighting and material properties.
fn shade(p: vec3<f32>, v: vec3<f32>) -> vec3<f32> {
    let lp: vec3<f32> = vec3<f32>(50., 20., 10.);
    let ld: vec3<f32> = normalize(p + lp);
    let n: vec3<f32> = normal(p);
    let fresnel: f32 = pow(max(0., 1. + dot(n, v)), 5.);
    var fin: vec3<f32> = vec3<f32>(0.);
    let ambient: vec3<f32> = vec3<f32>(0.1, 0.06, 0.035);
    let albedo: vec3<f32> = vec3<f32>(0.75, 0.9, 0.35);
    let sky: vec3<f32> = vec3<f32>(0.5, 0.65, 0.8) * 2.;
    var lamb: f32 = max(0., dot(n, ld));
    let spec: f32 = ggx(n, v, ld, 3., fresnel);
    let ss: f32 = max(0., subsurface(p, v, n));
    lamb = mix(lamb, 3.5 * smoothstep(0., 2., pow(ss, 0.6)), 0.7);
    fin = ambient + albedo * lamb + 25. * spec + fresnel * sky;
    return vec3<f32>(fin * 0.5);
}

// Main function for the fragment shader.
fn main(invocation_id: vec2<f32>) -> vec4<f32> {

  let R: vec2<f32> = uniforms.resolution.xy;
    let y_inverted_location = vec2<i32>(i32(invocation_id.x), i32(R.y) - i32(invocation_id.y));
    let location = vec2<i32>(i32(invocation_id.x), i32(y_inverted_location.y));

    var fragColor: vec4<f32>;
    var fragCoord = vec2<f32>(f32(location.x), f32(location.y));
    let uv: vec2<f32> = fragCoord / uniforms.resolution.xy;

    var a: vec3<f32> = vec3<f32>(0.);
    let campos: f32 = 5.1;
    var lerp: f32 = 0.5 + 0.5 * cos(campos * 0.4 - pi);
    lerp = smoothstep(0.13, 1., lerp);
    let c: vec3<f32> = mix(vec3<f32>(-0., 217., 0.), vec3<f32>(0., 4.4, -190.), pow(lerp, 1.));
    let rot: mat3x3<f32> = rotate(vec3<f32>(1., 0., 0.), pi / 2.);
    let ro2: mat3x3<f32> = rotate(vec3<f32>(1., 0., 0.), -0.008 * pi / 2.);
    var u2: vec2<f32> = -1. + 2. * uv;
    u2.x = u2.x * (uniforms.resolution.x / uniforms.resolution.y);
    var d: vec3<f32> = mix(normalize(vec3<f32>(u2, 20.) * rot), normalize(vec3<f32>(u2, 20.)) * ro2, pow(lerp, 1.11));
    d = normalize(d);
    let ii: vec3<f32> = intersect(c + 145. * d, d);
    let ss: vec3<f32> = shade(ii, d);
    a = a + (ss);
    var fragColorrgb = fragColor.rgb;
    fragColorrgb = a * (0.99 + 0.02 * hash(vec3<f32>(uv, 0.001 * uniforms.time)));
    fragColor.r = fragColorrgb.x;
    fragColor.g = fragColorrgb.y;
    fragColor.b = fragColorrgb.z;
    return fragColor;
}

// Fragment shader entry point.
@fragment
fn main_fragment(in: VertexOutput) -> @location(0) vec4<f32> {
    return main(in.pos.xy);
}
